import React from "react";
import {
  Router,
  Route,
  Routes,
  Link,
  BrowserRouter
} from "react-router-dom";



export default function BasicExample() {
  return (
    <BrowserRouter>

      <ul>
        <li>
          <Link to="/">Home</Link>
        </li>
      </ul>

      <hr />


      <Routes>
        <Route exact path="/" element={<Home />} />
      </Routes>

    </BrowserRouter>
  );
}



function Home() {
  return (
    <div>
      <h2>Home</h2>
    </div>
  );
}
